  input: TEXT,SA11A1,SA11A1.49490,"On 12/22/05 we received a contribution from Beurt
    SerVaas in the amount of $25,000 which was deposited into our federal account.  Fifteen
    thousand two hundred and fifty dollars was transferred to our non-federal account,
    which can accept unlimited contributions from individuals, on 12/22/05.  A letter
    was sent to Beurt SerVaas to advise him of how his deposit was split into our
    accounts and to offer him a chance for a refund.  According to AO 2001-17, the
    Commission has deemed it sufficient to deposit checks exceeding the federal limits
    into a federal account and then to make a transfer to the non-federal account
    for the portion that exceeds the federal limit.  Therefore, year to date aggregate
    totals reported by Beurt SerVaas on our report is a reflection of the federal
    portion of the donor's contributions to date."
